    check_cm = False
    check_key = False
    idx_cm = -1

    # Verifica os argumentos passados
    for idx, arg in enumerate(sys.argv):
        if arg.endswith('.cm'):
            check_cm = True
            idx_cm = idx
        if arg == "-k":
            check_key = True

    # Valida o número mínimo de argumentos
    if len(sys.argv) < 3:
        raise TypeError(error_handler.newError(check_key, 'ERR-LEX-USE'))

    # Verifica se o arquivo .cm foi fornecido e se existe
    if not check_cm:
        raise IOError(error_handler.newError(check_key, 'ERR-LEX-NOT-CM'))
    elif not os.path.exists(sys.argv[idx_cm]):
        raise IOError(error_handler.newError(check_key, 'ERR-LEX-FILE-NOT-EXISTS'))

    # Lê o conteúdo do arquivo .cm
    with open(sys.argv[idx_cm], 'r') as file:
        source_file = file.read()

    # Processa o conteúdo do arquivo
    if not check_cm:
        print("Def")
        print(moore)
        print("Entrada:")
        print(source_file)
        print("Tokens:")

    # Obtém e imprime a saída do processamento
    print(moore.get_output_from_string(source_file))


